import React from "react";
import Products from "../DB/products.json";

export const Headphone = (params, match) => {
  const headphone = Products.HEADPHONES.find(
    ({ id }) => id === match.params.headphoneId
  );
  return (
    <div>
      headphones
      {headphone.brand}
    </div>
  );
};
